import React, { Component } from 'react';
import screen1 from '../img/1.png';
import gif1 from '../img/screen1.gif';
import gif2 from '../img/screen2.gif';
import poster from '../img/poster.png';
class Demo extends Component {
  render() {
    return (
      <section id="Demo">
        <div className="row">
          <h1>About Our Game</h1>
            <h3>3D puzzle game in space</h3>
          <p className="Intro">About the game place holder 1233333</p>
          <img src={poster} alt="poster"/>
          <column>
             <img src={gif1} alt="gif1"  width="320" height="180"/>

             <img src={gif2} alt="gif2"  width="320" height="180" />

          </column>
        </div>
      </section>
    );
  }
}

export default Demo;
